import React, { Component } from 'react';

const Login = props => {
  return (
    <div>
      Login
      <form>
        <label>
          Name:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  )
}

export default Login
